DROP TABLE IF EXISTS  `t_sale_orderdetail`;
CREATE TABLE `t_sale_orderdetail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `biz_order_id` varchar(64) DEFAULT NULL,
  `biz_detail_id` varchar(64) DEFAULT NULL,
  `taobao_detail_status` varchar(64) DEFAULT NULL COMMENT '淘宝子订单状态',
