  UNIQUE KEY `biz_detail_id_inx` (`biz_detail_id`),
  KEY `biz_order_id_inx` (`biz_order_id`),
  KEY `et_shop_name_inx` (`et_shop_name`(255)) USING BTREE,
  KEY `shop_name_inx` (`shop_name`(255)) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8;

